INSERT INTO `article` VALUES (1, 1, 5, 'Shiro+SSM整合，认证授权', '环境：&nbsp; &nbsp; SSM+Maven步骤&nbsp;1.pom.xml导入相关jar包&lt;!--shiro--&gt;        &lt;dependency&gt;            &lt;groupId&gt;org.apache.shiro&lt;/groupId&gt;            &lt;artifactId&gt;shiro-core&lt;/artifactId&gt;            &lt;version&gt;1.4.0&lt;/version&gt;        &lt;/dependency&gt;        &lt;', '<ul><li><span style=\"font-weight: bold;\">环境：</span></li><li>&nbsp; &nbsp; SSM+Maven</li><li>步骤</li></ul><ol><li><strong>&nbsp;</strong>1<strong>.</strong>pom.xml导入相关jar包</li><li><pre><code>&lt;!--shiro--&gt;<br>        &lt;dependency&gt;<br>            &lt;groupId&gt;org.apache.shiro&lt;/groupId&gt;<br>            &lt;artifactId&gt;shiro-core&lt;/artifactId&gt;<br>            &lt;version&gt;1.4.0&lt;/version&gt;<br>        &lt;/dependency&gt;<br>        &lt;dependency&gt;<br>            &lt;groupId&gt;org.apache.shiro&lt;/groupId&gt;<br>            &lt;artifactId&gt;shiro-web&lt;/artifactId&gt;<br>            &lt;version&gt;1.4.0&lt;/version&gt;<br>        &lt;/dependency&gt;<br>        &lt;dependency&gt;<br>            &lt;groupId&gt;org.apache.shiro&lt;/groupId&gt;<br>            &lt;artifactId&gt;shiro-ehcache&lt;/artifactId&gt;<br>            &lt;version&gt;1.4.0&lt;/version&gt;<br>        &lt;/dependency&gt;<br>        &lt;dependency&gt;<br>            &lt;groupId&gt;org.apache.shiro&lt;/groupId&gt;<br>            &lt;artifactId&gt;shiro-spring&lt;/artifactId&gt;<br>            &lt;version&gt;1.4.0&lt;/version&gt;<br>        &lt;/dependency&gt;</code></pre><p>2.配置web.xml</p></li><li><pre><code>&lt;filter&gt;<br>        &lt;filter-name&gt;shiroFilter&lt;/filter-name&gt;<br>        &lt;filter-class&gt;org.springframework.web.filter.DelegatingFilterProxy&lt;/filter-class&gt;<br>        &lt;init-param&gt;<br>            &lt;param-name&gt;targetFilterLifecycle&lt;/param-name&gt;<br>            &lt;param-value&gt;true&lt;/param-value&gt;<br>        &lt;/init-param&gt;<br>    &lt;/filter&gt;<br>    &lt;filter-mapping&gt;<br>        &lt;filter-name&gt;shiroFilter&lt;/filter-name&gt;<br>        &lt;url-pattern&gt;/*&lt;/url-pattern&gt;<br>    &lt;/filter-mapping&gt;<br><br>    &lt;context-param&gt;<br>        &lt;param-name&gt;contextConfigLocation&lt;/param-name&gt;<br>        &lt;param-value&gt;<br>            classpath:spring/spring-mybatis.xml<br>            classpath:shiro/applicationContext-shiro.xml<br>        &lt;/param-value&gt;<br>    &lt;/context-param&gt;</code></pre><p>3. 定制自己的shiro服务</p></li><li><pre><code>&lt;?xml version=\"1.0\" encoding=\"UTF-8\"?&gt;<br>&lt;beans xmlns:xsi=\"http://www.w3.org/2001/XMLSchema-instance\"<br>       xmlns=\"http://www.springframework.org/schema/beans\"<br>       xsi:schemaLocation=\"http://www.springframework.org/schema/beans http://www.springframework.org/schema/beans/spring-beans.xsd\"&gt;<br>    &lt;!-- 配置 ShiroFilter bean--&gt;<br>    &lt;bean id=\"shiroFilter\" class=\"org.apache.shiro.spring.web.ShiroFilterFactoryBean\"&gt;<br>        &lt;property name=\"securityManager\" ref=\"securityManager\"/&gt;<br>        &lt;property name=\"loginUrl\" value=\"loginPage\"/&gt;<br>        &lt;property name=\"successUrl\" value=\"/\"/&gt;<br>        &lt;property name=\"unauthorizedUrl\" value=\"loginPage\"/&gt;<br>        &lt;!-- shiro过滤器的具体配置 --&gt;<br>        &lt;!-- anon-匿名访问，authc-需要认证 --&gt;<br>        &lt;property name=\"filterChainDefinitions\"&gt;<br>            &lt;value&gt;<br>                /login = anon<br>                /** = authc<br>            &lt;/value&gt;<br>        &lt;/property&gt;<br>    &lt;/bean&gt;<br>    &lt;!-- 配置 Shiro 的 SecurityManager Bean. --&gt;<br>    &lt;bean id=\"securityManager\" class=\"org.apache.shiro.web.mgt.DefaultWebSecurityManager\"&gt;<br>        &lt;property name=\"realm\" ref=\"myRealm\"/&gt;<br>    &lt;/bean&gt;<br>    &lt;!-- 配置 Bean 后置处理器: 会自动的调用和 Spring 整合后各个组件的生命周期方法. --&gt;<br>    &lt;bean id=\"lifecycleBeanPostProcessor\" class=\"org.apache.shiro.spring.LifecycleBeanPostProcessor\"/&gt;<br>    &lt;bean id=\"myRealm\" class=\"top.wanda92632.blog.shiro.MyRealm\"&gt;<br>    &lt;/bean&gt;<br>    &lt;!--登出处理--&gt;<br>    &lt;bean id=\"logout\" class=\"org.apache.shiro.web.filter.authc.LogoutFilter\"&gt;<br>        &lt;property name=\"redirectUrl\" value=\"/index\"/&gt;<br>    &lt;/bean&gt;<br>&lt;/beans&gt;</code></pre><p>4.自定义 Realm</p></li><li><pre><code>package top.wanda92632.blog.shiro;<br><br>import org.apache.shiro.authc.*;<br>import org.apache.shiro.authz.AuthorizationInfo;<br>import org.apache.shiro.authz.SimpleAuthorizationInfo;<br>import org.apache.shiro.realm.AuthorizingRealm;<br>import org.apache.shiro.subject.PrincipalCollection;<br>import org.apache.shiro.util.ByteSource;<br>import org.springframework.beans.factory.annotation.Autowired;<br>import top.wanda92632.blog.entity.Role;<br>import top.wanda92632.blog.entity.User;<br>import top.wanda92632.blog.service.impl.PermissionServiceImpl;<br>import top.wanda92632.blog.service.impl.RoleServiceImpl;<br>import top.wanda92632.blog.service.impl.UserServiceImpl;<br><br>import java.util.HashSet;<br>import java.util.List;<br>import java.util.Set;<br><br>public class MyRealm extends AuthorizingRealm {<br><br>    @Autowired<br>    UserServiceImpl userServiceImpl;<br>    @Autowired<br>    RoleServiceImpl roleServiceImpl;<br>    @Autowired<br>    PermissionServiceImpl permissionServiceImpl;<br><br>    /**<br>     * 授权<br>     * @param principalCollection<br>     * @return<br>     */<br>    @Override<br>    protected AuthorizationInfo doGetAuthorizationInfo(PrincipalCollection principalCollection) {<br>        //获取当前登录用户名<br>        String userName = principalCollection.getPrimaryPrincipal().toString();<br>        // 从数据库或者缓存中获取角色数据<br>        List&lt;Role&gt; roleList = roleServiceImpl.getRolesByUserName(userName);<br>        Set&lt;String&gt; roles = new HashSet&lt;&gt;();<br>        if(roleList.size()&gt;0){<br>            for(Role role :roleList){<br>                roles.add(role.getRoleName());<br>            }<br>        }else {<br>            return null;<br>        }<br>        // 从数据库或者缓存中获取权限数据<br>        Set&lt;String&gt; permissions = permissionServiceImpl.getPermissionsByUserName(userName);<br>        SimpleAuthorizationInfo info = new SimpleAuthorizationInfo();<br>        info.setRoles(roles);<br>        info.setStringPermissions(permissions);<br>        return info;<br>    }<br><br>    /**<br>     * 认证<br>     * @param authenticationToken<br>     * @return<br>     * @throws AuthenticationException<br>     */<br>    @Override<br>    protected AuthenticationInfo doGetAuthenticationInfo(AuthenticationToken authenticationToken) throws AuthenticationException {<br>        //获取token中的登录账户<br>        String userName = authenticationToken.getPrincipal().toString();<br>        //获取角色信息By用户名<br>        User user;<br>        user= userServiceImpl.findUserByUserName(userName);<br>        //如果没有查到,则抛出异常<br>        if(user==null){<br>            System.out.println(\"用户不存在\");<br>            return null;<br>        }<br>        //获取盐，用于对密码在加密算法(MD5)的基础上二次加密ֵ<br>        ByteSource byteSalt = ByteSource.Util.bytes(\"abcd\");<br>        //获取自定义Realm名<br>        String realmName=getName();<br>        SimpleAuthenticationInfo info = new SimpleAuthenticationInfo(user.getUserName(),user.getPassword(),byteSalt,realmName);<br>        //返回给调用login(token)方法<br>        return info;<br>    }<br>}</code></pre><p>5.controller层验证用户信息</p></li><li><pre><code>//创建Subject实例对象<br>        Subject subject = SecurityUtils.getSubject();<br>        //判断当前用户是否已登录<br>        if (subject.isAuthenticated() == false) {<br>            UsernamePasswordToken token = new UsernamePasswordToken(loginData.getUserName(), loginData.getPassword());<br>            try {<br>                subject.login(token);<br>            } catch (AuthenticationException e) {<br>                System.out.println(\"登陆失败\");<br>                mav.setViewName(\"login\");<br>                mav.addObject(\"state\",\"用户不存在或密码错误\");<br>                return mav;<br>            }<br>        } else {<br>            System.out.println(\"用户已经登录\");<br>        }</code></pre><p><br></p></li></ol>', 14, NULL, NULL, NULL, '2018-12-11', NULL, '0');
INSERT INTO `article` VALUES (6, 1, 1, '关于博主', '博主初心博主目前是一名大三学生，建立此站的初衷是把学到的东西，偶尔的一些灵感记录下来，分享给大家。如果有能帮助到大家的地方，我将非常荣幸。我的梦想是进入BTA这样的公司，可惜博主水平有限。还需要继续努力学习。当前动态感觉自己懂得东西还是好少好少。以前学习的态度也很浮躁了，想静下心来学习更多的东西，勿骄勿躁。我的梦想我的梦想是，去所有想去的地方，做所有想做的事，敲所有想敲的代码。学习交流群号：659343676联系方式&nbsp; &nbsp;QQ：1079941116', '<h3 style=\"text-align: left;\"><span style=\"font-weight: bold; text-decoration-line: underline;\">博主初心</span></h3><blockquote style=\"text-align: left;\">博主目前是一名大三学生，建立此站的初衷是把学到的东西，偶尔的一些灵感记录下来，分享给大家。如果有能帮助到大家的地方，我将非常荣幸。我的梦想是进入BTA这样的公司，可惜博主水平有限。还需要继续努力学习。</blockquote><h3><span style=\"font-weight: bold; text-decoration-line: underline;\">当前动态</span></h3><blockquote><span style=\"font-weight: bold;\"></span>感觉自己懂得东西还是好少好少。以前学习的态度也很浮躁了，想静下心来学习更多的东西，勿骄勿躁。</blockquote><h3><span style=\"text-decoration-line: underline; font-weight: bold;\">我的梦想</span></h3><blockquote>我的梦想是，去所有想去的地方，做所有想做的事，敲所有想敲的代码。</blockquote><h3><span style=\"font-weight: bold; text-decoration-line: underline;\">学习交流</span></h3><div>群号：659343676</div><div><img src=\"data:image/png;base64,\" style=\"max-width:100%;\"></div><h3><span style=\"font-weight: 700; text-decoration-line: underline;\">联系方式</span></h3><div>&nbsp; &nbsp;<span style=\"text-decoration-line: line-through;\"></span>QQ：1079941116</div><p><img src=\"data:image/jpeg;base64,\" style=\"max-width:100%;\"></p>', 86, NULL, NULL, NULL, '2019-01-13', NULL, '0');
INSERT INTO `article` VALUES (8, 1, 2, '透过防火墙获取真实IP地址', 'public String getIpAddress(HttpServletRequest request) {        // 获取请求主机IP地址,如果通过代理进来，则透过防火墙获取真实IP地址        String ip = request.getHeader(\"X-Forwarded-For\");        if (ip == null || ip.length() == 0 || \"unknown\".equalsIgnoreCase(ip)) {            if (ip == null || ip.length() == 0 || \"unknown\".equ', '<pre><code>public String getIpAddress(HttpServletRequest request) {<br>        // 获取请求主机IP地址,如果通过代理进来，则透过防火墙获取真实IP地址<br>        String ip = request.getHeader(\"X-Forwarded-For\");<br>        if (ip == null || ip.length() == 0 || \"unknown\".equalsIgnoreCase(ip)) {<br>            if (ip == null || ip.length() == 0 || \"unknown\".equalsIgnoreCase(ip)) {<br>                ip = request.getHeader(\"Proxy-Client-IP\");<br>            }<br>            if (ip == null || ip.length() == 0 || \"unknown\".equalsIgnoreCase(ip)) {<br>                ip = request.getHeader(\"WL-Proxy-Client-IP\");<br>            }<br>            if (ip == null || ip.length() == 0 || \"unknown\".equalsIgnoreCase(ip)) {<br>                ip = request.getHeader(\"HTTP_CLIENT_IP\");<br>            }<br>            if (ip == null || ip.length() == 0 || \"unknown\".equalsIgnoreCase(ip)) {<br>                ip = request.getHeader(\"HTTP_X_FORWARDED_FOR\");<br>            }<br>            if (ip == null || ip.length() == 0 || \"unknown\".equalsIgnoreCase(ip)) {<br>                ip = request.getRemoteAddr();<br>            }<br>        } else if (ip.length() &gt; 15) {<br>            String[] ips = ip.split(\",\");<br>            for (int index = 0; index &lt; ips.length; index++) {<br>                String strIp = ips[index];<br>                if (!(\"unknown\".equalsIgnoreCase(strIp))) {<br>                    ip = strIp;<br>                    break;<br>                }<br>            }<br>        }<br>        if (\"127.0.0.1\".equals(ip)) {<br>            //根据网卡取本机配置的IP<br>            InetAddress inet = null;<br>            try {<br>                inet = InetAddress.getLocalHost();<br>            } catch (Exception e) {<br>                e.printStackTrace();<br>            }<br>            ip = inet.getHostAddress();<br>        }<br>        return ip;<br>    }</code></pre><p><br></p>', 13, NULL, NULL, NULL, '2019-02-24', NULL, '0');
INSERT INTO `article` VALUES (9, 1, 9, 'Linux常用命令', '一、文件和目录1. cd命令（它用于切换当前目录，它的参数是要切换到的目录的路径，可以是绝对路径，也可以是相对路径）cd /home&nbsp;进入&nbsp;\'/ home\'&nbsp;目录cd ..&nbsp;返回上一级目录&nbsp;cd ../..&nbsp;返回上两级目录&nbsp;cd&nbsp;进入个人的主目录&nbsp;cd ~user1&nbsp;进入个人的主目录&nbsp;cd -&nbsp;返回上次所在的目录&nbsp;2. pwd命令pwd&nbsp;显示工作路径3. ls命令&nbsp;（查看文件与目录的命令，list之意）ls&nbsp;查看目录中的文件&nbsp;', '<p align=\"left\"><b>一、文件和目录</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b><span lang=\"EN-US\">1. cd</span></b><b>命令（</b>它用于切换当前目录，它的参数是要切换到的目录的路径，可以是绝对路径，也可以是相对路径<b>）</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">cd /home&nbsp;</span>进入<span lang=\"EN-US\">&nbsp;\'/ home\'&nbsp;</span>目录<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">cd ..&nbsp;</span>返回上一级目录<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">cd ../..&nbsp;</span>返回上两级目录<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">cd&nbsp;</span>进入个人的主目录<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">cd ~user1&nbsp;</span>进入个人的主目录<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">cd -&nbsp;</span>返回上次所在的目录<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b><span lang=\"EN-US\">2. pwd</span></b><b>命令</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">pwd&nbsp;</span>显示工作路径<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b><span lang=\"EN-US\">3. ls</span></b><b>命令<span lang=\"EN-US\">&nbsp;</span></b>（查看文件与目录的命令，<span lang=\"EN-US\">list</span>之意）<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">ls&nbsp;</span>查看目录中的文件<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">ls -l&nbsp;</span>显示文件和目录的详细资料<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">ls -a&nbsp;</span>列出全部文件，包含隐藏文件<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">ls -R&nbsp;</span>连同子目录的内容一起列出（递归列出），等于该目录下的所有文件都会显示出来<span lang=\"EN-US\">&nbsp;&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">ls *[0-9]*&nbsp;</span>显示包含数字的文件名和目录名<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b><span lang=\"EN-US\">4. cp&nbsp;</span></b><b>命令</b>（用于复制文件，<span lang=\"EN-US\">copy</span>之意，它还可以把多个文件一次性地复制到一个目录下）<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">-a&nbsp;</span>：将文件的特性一起复制<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">-p&nbsp;</span>：连同文件的属性一起复制，而非使用默认方式，与<span lang=\"EN-US\">-a</span>相似，常用于备份<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">-i&nbsp;</span>：若目标文件已经存在时，在覆盖时会先询问操作的进行<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">-r&nbsp;</span>：递归持续复制，用于目录的复制行为<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">-u&nbsp;</span>：目标文件与源文件有差异时才会复制<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b><span lang=\"EN-US\">5. mv</span></b><b>命令</b>（用于移动文件、目录或更名，<span lang=\"EN-US\">move</span>之意）<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">-f&nbsp;</span>：<span lang=\"EN-US\">force</span>强制的意思，如果目标文件已经存在，不会询问而直接覆盖<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">-i&nbsp;</span>：若目标文件已经存在，就会询问是否覆盖<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">-u&nbsp;</span>：若目标文件已经存在，且比目标文件新，才会更新<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b><span lang=\"EN-US\">6. rm&nbsp;</span></b><b>命令</b>（用于删除文件或目录，<span lang=\"EN-US\">remove</span>之意）<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">-f&nbsp;</span>：就是<span lang=\"EN-US\">force</span>的意思，忽略不存在的文件，不会出现警告消息<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">-i&nbsp;</span>：互动模式，在删除前会询问用户是否操作<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">-r&nbsp;</span>：递归删除，最常用于目录删除，它是一个非常危险的参数<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\"><o:p>&nbsp;</o:p></span></p><p align=\"left\"><b>二、查看文件内容</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b><span lang=\"EN-US\">7. cat</span></b><b>命令（</b>用于查看文本文件的内容，后接要查看的文件名，通常可用管道与<span lang=\"EN-US\">more</span>和<span lang=\"EN-US\">less</span>一起使用<b>）</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">cat file1&nbsp;</span>从第一个字节开始正向查看文件的内容<span lang=\"EN-US\">&nbsp;<o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">tac file1&nbsp;</span>从最后一行开始反向查看一个文件的内容<span lang=\"EN-US\">&nbsp;<o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">cat -n file1&nbsp;</span>标示文件的行数<span lang=\"EN-US\">&nbsp;<o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">more file1&nbsp;</span>查看一个长文件的内容<span lang=\"EN-US\">&nbsp;<o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">head -n 2 file1&nbsp;</span>查看一个文件的前两行<span lang=\"EN-US\">&nbsp;<o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">tail -n 2 file1&nbsp;</span>查看一个文件的最后两行<span lang=\"EN-US\">&nbsp;<o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">tail -n +1000 file1&nbsp;</span>从<span lang=\"EN-US\">1000</span>行开始显示，显示<span lang=\"EN-US\">1000</span>行以后的<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">cat filename | head -n 3000 | tail -n +1000&nbsp;</span>显示<span lang=\"EN-US\">1000</span>行到<span lang=\"EN-US\">3000</span>行<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">cat filename | tail -n +3000 | head -n 1000&nbsp;</span>从第<span lang=\"EN-US\">3000</span>行开始，显示<span lang=\"EN-US\">1000(</span>即显示<span lang=\"EN-US\">3000~3999</span>行<span lang=\"EN-US\">)<o:p></o:p></span></p><p align=\"left\"><b>三、文件搜索<span lang=\"EN-US\">&nbsp;</span></b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b><span lang=\"EN-US\">8. find</span></b><b>命令（）</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">find / -name file1&nbsp;</span>从<span lang=\"EN-US\">&nbsp;\'/\'&nbsp;</span>开始进入根文件系统搜索文件和目录<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">find / -user user1&nbsp;</span>搜索属于用户<span lang=\"EN-US\">&nbsp;\'user1\'&nbsp;</span>的文件和目录<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">find /usr/bin -type f -atime +100&nbsp;</span>搜索在过去<span lang=\"EN-US\">100</span>天内未被使用过的执行文件<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">find /usr/bin -type f -mtime -10&nbsp;</span>搜索在<span lang=\"EN-US\">10</span>天内被创建或者修改过的文件<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">whereis halt&nbsp;</span>显示一个二进制文件、源码或<span lang=\"EN-US\">man</span>的位置<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">which halt&nbsp;</span>显示一个二进制文件或可执行文件的完整路径<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\"><o:p>&nbsp;</o:p></span></p><p align=\"left\">删除大于<span lang=\"EN-US\">50M</span>的文件：<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">find /var/mail/ -size +50M -exec rm {}&nbsp;</span>＼<span lang=\"EN-US\">;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b>四、文件的权限<span lang=\"EN-US\">&nbsp;-&nbsp;</span>使用<span lang=\"EN-US\">&nbsp;\"+\"&nbsp;</span>设置权限，使用<span lang=\"EN-US\">&nbsp;\"-\"&nbsp;</span>用于取消<span lang=\"EN-US\">&nbsp;</span></b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b><span lang=\"EN-US\">9. chmod&nbsp;</span></b><b>命令</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">ls -lh&nbsp;</span>显示权限<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">chmod ugo+rwx directory1&nbsp;</span>设置目录的所有人<span lang=\"EN-US\">(u)</span>、群组<span lang=\"EN-US\">(g)</span>以及其他人<span lang=\"EN-US\">(o)</span>以读（<span lang=\"EN-US\">r</span>，<span lang=\"EN-US\">4&nbsp;</span>）、写<span lang=\"EN-US\">(w</span>，<span lang=\"EN-US\">2)</span>和执行<span lang=\"EN-US\">(x</span>，<span lang=\"EN-US\">1)</span>的权限<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">chmod go-rwx directory1&nbsp;</span>删除群组<span lang=\"EN-US\">(g)</span>与其他人<span lang=\"EN-US\">(o)</span>对目录的读写执行权限<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b><span lang=\"EN-US\">10. chown&nbsp;</span></b><b>命令（</b>改变文件的所有者<b>）</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">chown user1 file1&nbsp;</span>改变一个文件的所有人属性<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">chown -R user1 directory1&nbsp;</span>改变一个目录的所有人属性并同时改变改目录下所有文件的属性<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">chown user1:group1 file1&nbsp;</span>改变一个文件的所有人和群组属性<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b><span lang=\"EN-US\">11. chgrp&nbsp;</span></b><b>命令（</b>改变文件所属用户组<b>）</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">chgrp group1 file1&nbsp;</span>改变文件的群组<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\"><o:p>&nbsp;</o:p></span></p><p align=\"left\"><b>五、文本处理<span lang=\"EN-US\">&nbsp;</span></b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b><span lang=\"EN-US\">12. grep&nbsp;</span></b><b>命令</b>（分析一行的信息，若当中有我们所需要的信息，就将该行显示出来，该命令通常与管道命令一起使用，用于对一些命令的输出进行筛选加工等等）<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">grep Aug /var/log/messages&nbsp;</span>在文件<span lang=\"EN-US\">&nbsp;\'/var/log/messages\'</span>中查找关键词<span lang=\"EN-US\">\"Aug\"&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">grep ^Aug /var/log/messages&nbsp;</span>在文件<span lang=\"EN-US\">&nbsp;\'/var/log/messages\'</span>中查找以<span lang=\"EN-US\">\"Aug\"</span>开始的词汇<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">grep [0-9] /var/log/messages&nbsp;</span>选择<span lang=\"EN-US\">&nbsp;\'/var/log/messages\'&nbsp;</span>文件中所有包含数字的行<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">grep Aug -R /var/log/*&nbsp;</span>在目录<span lang=\"EN-US\">&nbsp;\'/var/log\'&nbsp;</span>及随后的目录中搜索字符串<span lang=\"EN-US\">\"Aug\"&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">sed \'s/stringa1/stringa2/g\' example.txt&nbsp;</span>将<span lang=\"EN-US\">example.txt</span>文件中的<span lang=\"EN-US\">&nbsp;\"string1\"&nbsp;</span>替换成<span lang=\"EN-US\">&nbsp;\"string2\"&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">sed \'/^$/d\' example.txt&nbsp;</span>从<span lang=\"EN-US\">example.txt</span>文件中删除所有空白行<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b><span lang=\"EN-US\">13. paste&nbsp;</span></b><b>命令</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">paste file1 file2&nbsp;</span>合并两个文件或两栏的内容<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">paste -d \'+\' file1 file2&nbsp;</span>合并两个文件或两栏的内容，中间用<span lang=\"EN-US\">\"+\"</span>区分<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b><span lang=\"EN-US\">14. sort&nbsp;</span></b><b>命令</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">sort file1 file2&nbsp;</span>排序两个文件的内容<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">sort file1 file2 | uniq&nbsp;</span>取出两个文件的并集<span lang=\"EN-US\">(</span>重复的行只保留一份<span lang=\"EN-US\">)&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">sort file1 file2 | uniq -u&nbsp;</span>删除交集，留下其他的行<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">sort file1 file2 | uniq -d&nbsp;</span>取出两个文件的交集<span lang=\"EN-US\">(</span>只留下同时存在于两个文件中的文件<span lang=\"EN-US\">)&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b><span lang=\"EN-US\">15. comm&nbsp;</span></b><b>命令</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">comm -1 file1 file2&nbsp;</span>比较两个文件的内容只删除<span lang=\"EN-US\">&nbsp;\'file1\'&nbsp;</span>所包含的内容<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">comm -2 file1 file2&nbsp;</span>比较两个文件的内容只删除<span lang=\"EN-US\">&nbsp;\'file2\'&nbsp;</span>所包含的内容<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">comm -3 file1 file2&nbsp;</span>比较两个文件的内容只删除两个文件共有的部分<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b>六、打包和压缩文件<span lang=\"EN-US\">&nbsp;</span></b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b><span lang=\"EN-US\">16. tar&nbsp;</span></b><b>命令（</b>对文件进行打包，默认情况并不会压缩，如果指定了相应的参数，它还会调用相应的压缩程序（如<span lang=\"EN-US\">gzip</span>和<span lang=\"EN-US\">bzip</span>等）进行压缩和解压<b>）</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">-c&nbsp;</span>：新建打包文件<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">-t&nbsp;</span>：查看打包文件的内容含有哪些文件名<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">-x&nbsp;</span>：解打包或解压缩的功能，可以搭配<span lang=\"EN-US\">-C</span>（大写）指定解压的目录，注意<span lang=\"EN-US\">-c,-t,-x</span>不能同时出现在同一条命令中<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">-j&nbsp;</span>：通过<span lang=\"EN-US\">bzip2</span>的支持进行压缩<span lang=\"EN-US\">/</span>解压缩<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">-z&nbsp;</span>：通过<span lang=\"EN-US\">gzip</span>的支持进行压缩<span lang=\"EN-US\">/</span>解压缩<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">-v&nbsp;</span>：在压缩<span lang=\"EN-US\">/</span>解压缩过程中，将正在处理的文件名显示出来<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">-f filename&nbsp;</span>：<span lang=\"EN-US\">filename</span>为要处理的文件<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">-C dir&nbsp;</span>：指定压缩<span lang=\"EN-US\">/</span>解压缩的目录<span lang=\"EN-US\">dir</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b>压缩</b>：<span lang=\"EN-US\">tar -jcv -f filename.tar.bz2&nbsp;</span>要被处理的文件或目录名称<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b>查询</b>：<span lang=\"EN-US\">tar -jtv -f filename.tar.bz2</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b>解压</b>：<span lang=\"EN-US\">tar -jxv -f filename.tar.bz2 -C&nbsp;</span>欲解压缩的目录<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\"><o:p>&nbsp;</o:p></span></p><p align=\"left\"><span lang=\"EN-US\">bunzip2 file1.bz2&nbsp;</span>解压一个叫做<span lang=\"EN-US\">&nbsp;\'file1.bz2\'</span>的文件<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">bzip2 file1&nbsp;</span>压缩一个叫做<span lang=\"EN-US\">&nbsp;\'file1\'&nbsp;</span>的文件<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">gunzip file1.gz&nbsp;</span>解压一个叫做<span lang=\"EN-US\">&nbsp;\'file1.gz\'</span>的文件<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">gzip file1&nbsp;</span>压缩一个叫做<span lang=\"EN-US\">&nbsp;\'file1\'</span>的文件<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">gzip -9 file1&nbsp;</span>最大程度压缩<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">rar a file1.rar test_file&nbsp;</span>创建一个叫做<span lang=\"EN-US\">&nbsp;\'file1.rar\'&nbsp;</span>的包<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">rar a file1.rar file1 file2 dir1&nbsp;</span>同时压缩<span lang=\"EN-US\">&nbsp;\'file1\', \'file2\'&nbsp;</span>以及目录<span lang=\"EN-US\">&nbsp;\'dir1\'&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">rar x file1.rar&nbsp;</span>解压<span lang=\"EN-US\">rar</span>包<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\"><o:p>&nbsp;</o:p></span></p><p align=\"left\"><span lang=\"EN-US\">zip file1.zip file1&nbsp;</span>创建一个<span lang=\"EN-US\">zip</span>格式的压缩包<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">unzip file1.zip&nbsp;</span>解压一个<span lang=\"EN-US\">zip</span>格式压缩包<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">zip -r file1.zip file1 file2 dir1&nbsp;</span>将几个文件和目录同时压缩成一个<span lang=\"EN-US\">zip</span>格式的压缩包<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\"><o:p>&nbsp;</o:p></span></p><p align=\"left\"><b>七、系统和关机<span lang=\"EN-US\">&nbsp;(</span>系统的关机、重启以及登出<span lang=\"EN-US\">&nbsp;)&nbsp;</span></b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">shutdown -h now&nbsp;</span>关闭系统<span lang=\"EN-US\">(1)&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">init 0&nbsp;</span>关闭系统<span lang=\"EN-US\">(2)&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">telinit 0&nbsp;</span>关闭系统<span lang=\"EN-US\">(3)&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">shutdown -h hours:minutes &amp;&nbsp;</span>按预定时间关闭系统<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">shutdown -c&nbsp;</span>取消按预定时间关闭系统<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">shutdown -r now&nbsp;</span>重启<span lang=\"EN-US\">(1)&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">reboot&nbsp;</span>重启<span lang=\"EN-US\">(2)&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">logout&nbsp;</span>注销<span lang=\"EN-US\">&nbsp;</span><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">time&nbsp;</span>测算一个命令（即程序）的执行时间<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b>八、进程相关的命令</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b><span lang=\"EN-US\">jps</span></b><b>命令&nbsp;</b><b>（</b>显示当前系统的<span lang=\"EN-US\">java</span>进程情况，及其<span lang=\"EN-US\">id</span>号<b>）</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">jps(Java Virtual Machine Process Status Tool)</span>是<span lang=\"EN-US\">JDK 1.5</span>提供的一个显示当前所有<span lang=\"EN-US\">java</span>进程<span lang=\"EN-US\">pid</span>的命令，简单实用，非常适合在<span lang=\"EN-US\">linux/unix</span>平台上简单察看当前<span lang=\"EN-US\">java</span>进程的一些简单情况。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\"><o:p>&nbsp;</o:p></span></p><p align=\"left\"><b><span lang=\"EN-US\">ps</span></b><b>命令</b>&nbsp;（用于将某个时间点的进程运行情况选取下来并输出，<span lang=\"EN-US\">process</span>之意）<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">-A&nbsp;</span>：所有的进程均显示出来<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">-a&nbsp;</span>：不与<span lang=\"EN-US\">terminal</span>有关的所有进程<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">-u&nbsp;</span>：有效用户的相关进程<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">-x&nbsp;</span>：一般与<span lang=\"EN-US\">a</span>参数一起使用，可列出较完整的信息<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">-l&nbsp;</span>：较长，较详细地将<span lang=\"EN-US\">PID</span>的信息列出<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\"><o:p>&nbsp;</o:p></span></p><p align=\"left\"><span lang=\"EN-US\">ps aux #&nbsp;</span>查看系统所有的进程数据<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">ps ax #&nbsp;</span>查看不与<span lang=\"EN-US\">terminal</span>有关的所有进程<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">ps -lA #&nbsp;</span>查看系统所有的进程数据<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">ps axjf #&nbsp;</span>查看连同一部分进程树状态<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\"><o:p>&nbsp;</o:p></span></p><p align=\"left\"><b><span lang=\"EN-US\">kill</span></b><b>命令&nbsp;</b>（用于向某个工作（<span lang=\"EN-US\">%jobnumber</span>）或者是某个<span lang=\"EN-US\">PID</span>（数字）传送一个信号，它通常与<span lang=\"EN-US\">ps</span>和<span lang=\"EN-US\">jobs</span>命令一起使用）<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b><span lang=\"EN-US\">killall</span></b><b>命令</b>&nbsp;（向一个命令启动的进程发送一个信号）<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\"><o:p>&nbsp;</o:p></span></p><p align=\"left\"><b><span lang=\"EN-US\">top</span></b><b>命令&nbsp;</b>是<span lang=\"EN-US\">Linux</span>下常用的性能分析工具，<b>能够实时显示系统中各个进程的资源占用状况</b>，类似于<span lang=\"EN-US\">Windows</span>的任务管理器。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\"><o:p>&nbsp;</o:p></span></p><p align=\"left\">如何杀死进程：<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\">（<span lang=\"EN-US\">1</span>）图形化界面的方式<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\">（<span lang=\"EN-US\">2</span>）<span lang=\"EN-US\">kill -9 pid&nbsp;</span>（<span lang=\"EN-US\">-9</span>表示强制关闭）<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\">（<span lang=\"EN-US\">3</span>）<span lang=\"EN-US\">killall -9&nbsp;</span>程序的名字<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\">（<span lang=\"EN-US\">4</span>）<span lang=\"EN-US\">pkill&nbsp;</span>程序的名字<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\"><o:p>&nbsp;</o:p></span></p><p align=\"left\"><b>查看进程端口号：</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">netstat -tunlp|grep&nbsp;</span>端口号<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\"><o:p>&nbsp;</o:p></span></p><p align=\"left\"><b>九、普通文件和目录文件的区别</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b><span lang=\"EN-US\">9.1&nbsp;</span></b><b>文件的类型</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">Linux</span>下面一切皆文件，配置是文件，设备是文件，目录也是特殊的文件，文件有如下几种：<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">d</span>：目录文件的标识是，<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">-</span>：普通文件标识，<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">l</span>：软连接文件，亦称符号链接文件；<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">b</span>，块文件，是设备文件的一种（还有另一种），<span lang=\"EN-US\">b</span>是<span lang=\"EN-US\">block</span>的简写。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">c</span>，字符文件，也是设备文件的一种，<span lang=\"EN-US\">c</span>是<span lang=\"EN-US\">character</span>的文件。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b><span lang=\"EN-US\">9.2&nbsp;</span></b><b>普通文件和目录文件</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\">普通文件：存储普通数据，一般就是字符串。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\">目录文件：存储了一张表，该表就是该目录文件下，所有文件名和<span lang=\"EN-US\">inode</span>的映射关系。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><b><span lang=\"EN-US\">9.3&nbsp;</span></b><b>权限的区别</b><span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\">对于普通文件来说，<span lang=\"EN-US\">rwx</span>的意义是：<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">r</span>：可以获得这个普通文件的名字和内容。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">w</span>：可以修改这个文件的内容和文件名。可以删除该文件。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">x</span>：该文件是否具有被执行的权限。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\"><o:p>&nbsp;</o:p></span></p><p align=\"left\">对于目录文件来说，<span lang=\"EN-US\">rwx</span>的意义是：<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">r</span>：表示具有读取目录结构列表的权限，所以当你具有读取<span lang=\"EN-US\">(r)</span>一个目录的权限时，表示你可以查询该目录下的文件名。 就可以利用<span lang=\"EN-US\">&nbsp;ls&nbsp;</span>这个命令将该目录的内容列表显示出来，<span lang=\"EN-US\">&nbsp;</span>必须这个目录有<span lang=\"EN-US\">x</span>的权限，才可以进入这个目录。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">w</span>：移动该目录结构列表的权限（建立新的文件与目录、删除已经存在的文件与目录、更名、移动位置）。<span lang=\"EN-US\"><o:p></o:p></span></p><p align=\"left\"><span lang=\"EN-US\">x</span>：目录不可以被执行，目录的<span lang=\"EN-US\">x</span>代表的是用户能否进入该目录成为工作目录。<span lang=\"EN-US\"><o:p></o:p></span></p><p><span lang=\"EN-US\"><o:p>&nbsp;</o:p></span></p>', 17, NULL, NULL, NULL, '2019-03-14', NULL, '0');
INSERT INTO `article` VALUES (10, 1, 2, 'String类两种实例化的区别', 'String str1= \"hello\";String str2 = new String(\"hello\");public class Main {    public static void main(String[] args) {        String str1= \"ABCDEFG\";        String str2=\"ABCDEFG\";        String str3=\"ABCD\"+\"EFG\";        String str4 = new String(\"ABCDEFG\");        String str5 = new String(\"ABCDEFG\").', '<pre><code>String str1= \"hello\";<br>String str2 = new String(\"hello\");</code></pre><p><img src=\"data:image/png;base64,\" style=\"max-width:100%;\"></p><pre><code>public class Main {<br><br>    public static void main(String[] args) {<br><br>        String str1= \"ABCDEFG\";<br>        String str2=\"ABCDEFG\";<br>        String str3=\"ABCD\"+\"EFG\";<br>        String str4 = new String(\"ABCDEFG\");<br>        String str5 = new String(\"ABCDEFG\").intern();<br>        System.out.println(str1==\"ABCDEFG\");//true<br>        System.out.println(str1==str2);//true<br>        System.out.println(str1==str3);//true<br>        System.out.println(str1==str4);//false<br>        System.out.println(str1==str5);//true<br>    }<br>}</code></pre><p><br></p>', 12, NULL, NULL, NULL, '2018-12-07', NULL, '0');
INSERT INTO `article` VALUES (12, 1, 2, '对ORM的理解', '想要了解什么ORM,先了解什么是“持久化”，什么是“持久层”持久化：就是把数据存储到可永久保存的存储设备中，例如磁盘。例如用户注册，将用户的注册信息（账号，密码等）存储到数据库中的过程就是持久化。持久层：即专门用来实现数据持久化的逻辑层,Dao层就是持久层，与数据库进行交互。什么是ORM?O - ObjectR - Relational&nbsp;M - Mapping即对象关系映射，他的作用是在关系型数据库和对象之间作一个映射，在操作数据库的时候，就不需要再去和复杂的SQL语句打交道，就像平时操作对象一样操作数据库。', '<div><div>想要了解什么ORM,先了解什么是“持久化”，什么是“持久层”</div><ul><li><div>持久化：就是把数据存储到可永久保存的存储设备中，例如磁盘。例如用户注册，将用户的注册信息（账号，密码等）存储到数据库中的过程就是持久化。</div></li><li><div>持久层：即专门用来实现数据持久化的逻辑层,Dao层就是持久层，与数据库进行交互。</div></li></ul><div><br></div><div>什么是ORM?</div><ul><li><div>O - Object</div></li><li><div>R - <span>Relational</span><span>&nbsp;</span></div></li><li><div><span>M -</span> <span>Mapping</span></div></li></ul><div><span>即对象关系映射，他的作用是在关系型数据库和对象之间作一个映射，在操作数据库的时候，就不需要再去和复杂的SQL语句打交道，就像平时操作对象一样操作数据库。</span></div></div><p></p><div><br></div>', 96, NULL, NULL, NULL, '2019-07-13', NULL, '0');
