INSERT INTO `article` VALUES (15, 1, 5, 'IDEA中Mybatis SQL语句同时使用where+ORDER+LIMIT报错“Unable to resolve table \'LIMIT\'”', '今天在写SQL语句时，同时使用&lt;where&gt;和ORDER、LIMIT时IDEA一直提示报错“Unable to resolve table”，检查了半天还是检查不出来哪里错了，换成 offset&nbsp;也没什么卵用，只有删掉&lt;where&gt;或者删除掉“ORDER BY s.priority DESC”IDEA才不会报错，搞了半天没搞清楚错在哪里，正常测试，结果能正常查询到数据，真是醉了，GR的IDEA浪费我半天时间。', '<p style=\"text-align: left;\">今天在写SQL语句时，同时使用&lt;where&gt;和ORDER、LIMIT时IDEA一直提示报错“Unable to resolve table”，检查了半天还是检查不出来哪里错了，换成 offset&nbsp;也没什么卵用，只有删掉&lt;where&gt;或者删除掉“ORDER BY s.priority DESC”IDEA才不会报错，搞了半天没搞清楚错在哪里，正常测试，结果能正常查询到数据，真是醉了，GR的IDEA浪费我半天时间。</p><p style=\"text-align: center;\"><img src=\"data:image/png;base64,\" style=\"max-width:100%;\"></p><p style=\"text-align: center;\"><img src=\"data:image/png;base64,\" style=\"max-width:100%;\"></p>', 10, NULL, NULL, NULL, '2019-07-14', NULL, '0');
